create table TB_FLUXO_CAIXA
(
    co_fluxo_caixa        int auto_increment,
    dt_cadastro           datetime     null,
    dt_realizado          date         null,
    dt_vencimento         date         null,
    nu_valor              float(12, 2) null,
    nu_valor_pago         float(12, 2) null,
    ds_descricao          text         null,
    tp_fluxo              int(1)       null comment '1 - Entrada / 2 - Saída',
    tp_pagamento          int(1)       null comment 'GRATIS = 0 / DINHEIRO = 1 / CARTAO_DEBITO = 2 / CARTAO_CREDITO = 3 /  PIX = 4 / BOLETO = 5 / PROMISSORIA = 6 / CHEQUE = 7 / PARCELAMENTO_PROPRIO = 8 / OUTROS = 9 ',
    st_pagamento          int(1)       null comment '1 - A Pagar / 2 - A Receber / 3 - Pago / 4 - Em Atraso ',
    co_categoria_fc       int          not null,
    co_categoria_fc_filha int          not null,
    co_categoria_fc_neta  int          not null,
    co_centro_custo       int          not null,
    co_conta_bancaria     int          not null,
    co_representacao      int          not null,
    co_usuario            int(10)      not null,
    co_assinante          int          not null,
    primary key (co_fluxo_caixa, co_categoria_fc, co_categoria_fc_filha, co_categoria_fc_neta, co_centro_custo,
                 co_conta_bancaria, co_representacao, co_usuario, co_assinante)
);

